import React from 'react';
import styled from "styled-components";

const StyledHeader = styled.header`
  display: flex;
  background-color: ${({ theme }) => theme.colors.success};
  height: 10vh;
  width: 100%;
  font-size: 1.5rem;
`

function Header() {
  return (
    <>
      <StyledHeader>Test header here</StyledHeader>
    </>
  );
}

export default Header;
